class hash32_family128
{
public:
    //---------------------------------------------------------------
    using result_type = std::uint32_t;


    //---------------------------------------------------------------
    result_type operator () (std::uint16_t member, std::uint8_t key) const noexcept
    {
        return constants::randInts[member][key & 255];
    }
    //-----------------------------------------------------
    result_type operator () (std::uint16_t member, std::uint16_t key) const noexcept
    {
        return constants::randInts[member  ][key & 255]
             ^ constants::randInts[member+1][(key & 65280) >> 8];
    }
    //-----------------------------------------------------
    result_type operator () (std::uint16_t member, std::uint32_t key) const noexcept
    {
        return constants::randInts[member  ][key & 255]
             ^ constants::randInts[member+1][(key & 65280) >> 8]
             ^ constants::randInts[member+2][(key & 16711680) >> 16]
             ^ constants::randInts[member+3][(key & 4278190080) >> 24];
    }
    //-----------------------------------------------------
    result_type operator () (std::uint16_t, std::uint64_t) const = delete;

};


